import styled from 'styled-components';

export const KeyList = styled.ul`
  display: flex;
  flex-wrap: wrap;
  list-style: none;
  gap: 10px;
`;

export const KeyItem = styled.li`
  background-color: rgb(216, 214, 183);
  border-radius: 2px;
  padding: 10px;
  :hover {
    cursor: pointer;
  }
`;
